using Motorcycle_Rental_Domain.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Motorcycle_Rental_Tests.Builder
{
    public class DeliveryManBuilder
    {
        public string Identifier { get; set; }
        public string Name { get; set; }
        public string CNPJ { get; set; }
        public DateTime BirthDate { get; set; }
        public string CNHNumber { get; set; }
        public string CNHType { get; set; }
        public string CNHImage { get; set; }

        public DeliveryManBuilder()
        {
            Identifier = "entregador1";
            Name = "Paulo";
            CNPJ = "12345678912345";
            BirthDate = DateTime.UtcNow;
            CNHNumber = "12323434567";
            CNHType = "A";
            CNHImage = "";
        }

        public DeliveryManBuilder WithIdentifier(string identifier)
        {
            Identifier = identifier;
            return this;
        }
        public DeliveryManBuilder WithName(string name)
        {
            Name = name;
            return this;
        }
        public DeliveryManBuilder WithCNPJ(string cnpj)
        {
            CNPJ = cnpj;
            return this;
        }
        public DeliveryManBuilder WithBirthDate(DateTime birthDate)
        {
            BirthDate = birthDate;
            return this;
        }

        public DeliveryManBuilder WithCNHNumber(string cnhNumber)
        {
            CNHNumber = cnhNumber;
            return this;
        }
        public DeliveryManBuilder WithCNHType(string cnhType)
        {
            CNHType = cnhType;
            return this;
        }
        public DeliveryManBuilder WithCNHImage(string cnhImage)
        {
            CNHImage = cnhImage;
            return this;
        }
        public DeliveryMan Build()
        {
            return new DeliveryMan
            {
                Identifier = this.Identifier,
                Name = this.Name,
                CNPJ = this.CNPJ,
                BirthDate = this.BirthDate,
                CNHNumber = this.CNHNumber,
                CNHType = this.CNHType,
                CNHImage = this.CNHImage,

            };
        }
    }
}
